import { Provider } from "react-redux";
import AppLayout from "../components/AppLayout";
import wrapper from "../store/configureStore";

const Home = () => {
  return (
    <Provider store={wrapper}>
      <AppLayout>
        <div>Hello, Next!</div>
      </AppLayout>
    </Provider>
  );
};

export default Home;
